【特長】<br>●寿命が長い新3906バイメタルハンドソー（研磨歯）付です。<br>●取り付け方の工夫でノコ歯を広く使用でき周囲が囲まれた所でもコンパスソー、セーバーソーなどのさまざまな切断ができます。<br>●コーナーの狭い所でも刃を曲げて使用できます。<br><br>【用途】<br><br>【仕様】<br>●使用ノコ刃サイズ(mm):250<br>●付属刃:バイメタルノコ刃1枚付<br><br>【材質／仕上】<br>●アルミダイカスト<br><br>【ＪＡＮコード】<br>7311518017545<br><br>【メーカ－名】<br>スナップオン・ツールズ（株）<br><br>【原産国】<br>イタリア<br><br>【質量】<br>●260g<style type="text/css">
/*買い物かごに入れるボタン*/
#rakutenLimitedId_aroundCart input[value="買い物かごに入れる"]{
background: url("http://image.rakuten.co.jp/unoonline/cabinet/sparts/imgrc0063268325.gif") left top no-repeat;
width:270px;
height:60px;
text-indent:100%;
white-space:nowrap;
overflow:hidden;
border: none;
padding:0;
margin-top:5px 0;
cursor:pointer;
}
#rakutenLimitedId_aroundCart tbody tr td input:hover{
alpha(opacity=8);
-moz-opacity:0.8;
opacity:0.8;
cursor:pointer;
}
</style>

【特長】<br>●4つの刃（ストレート刃・ギザ刃・ワイヤーカッター・ダンボールオープナー)で特殊な素材も逃さずカットできます。<br>●グリップを閉じた時に指を詰めることがないように、ガードが取り付けられています。<br>●多様な素材をザクザク切断できるギザ刃で高硬度の特殊極細繊維にも対応します。<br>●グリップの外側からもしっかりと握り込めるようにグリップにスリットを入れています。<br>●デザイン的なアクセントにもなっているS字ラインは、握力を刃先に無駄なく伝えます。<br>●落下防止のストラップを取り付けられるストラップホール付です。<br>●ブレードを保護するための保護キャップ付です。<br>●刃が濡れたまま収納しても水が溜まらないようにスリットがあり、通気性にも優れています。<br><br>【用途】<br>●工房や現場でのプロユースから、アウトドア、DIY、キッチンワーク等の切断作業に便利です。<br><br>【仕様】<br>●刃厚(mm):3<br>●刃長(mm):56±3<br>●全長(mm):160<br>●ワイヤーカッター切断能力(銅線)：φ1.6mm、(針金)：φ1.2mm<br>●ギザ刃切断能力(トラロープ)：φ10mm、(キャブタイヤ)：φ9mm、(綿被覆コード)：φ8mm、(革ベルト)：厚み4mm<br><br>【セット内容】<br>●キャップ<br><br>【材質／仕上】<br>●刃部：ステンレス合金<br>●グリップ：PBT<br>●キャップ：PBT<br>●センターピン：SUS303<br><br>【ＪＡＮコード】<br>4989833034559<br><br>【メーカ－名】<br>（株）エンジニア<br><br>【原産国】<br>日本<br><br>【質量】<br>●120g<style type="text/css">
