パシペート仕上げ・・・不動態化処理により、通常のステンビスにより耐食性、防錆性が向上。<BR>材質：SUS410　仕上：パシペート仕上　サイズ：M4×25mm　頭径：22．0mm　ネジ部寸法：3．4～3．5mm　ドリル径：3．4～3．5mm　パック入数：200本。<style type="text/css">
